@Adoradomingo1 @cheshirecat847 @KyivIndependent It's currently their position.

Just pointing out that framing this as an eternal absolute isn't their policy; and thus we should be careful not to frame it as such.

Ukraine will decide when/what/how it exercises its sovereignty + we should give them the space to do that.

@dw_ukrainian Kindly ask everyone and everybody to support Ukraine in war for liberty! Together we will prevail! 
